            <div className="flex flex-col items-center md:items-start">
                <span className="text-2xl md:text-5xl color-main">THANAPON CHANLA-OR</span>
                <span className="text-2xl md:text-5xl text-white">Front-End Developer</span>
            </div>
        </div>
      );
}
